export default {
  data: function data() {
    return {
      show: true,
      dialogVisible: false,
      form: {
        name: '',
        number: '',
        time: '',
        leibie: '',
        textarea: '',
        jianchayuan: '1',
        lvshi: '1'
      }
    };
  },
  created: function created() {},
  mounted: function mounted() {},
  methods: {
    beginJf: function beginJf() {
      var _this = this;

      for (var k in this.form) {
        if (this.form[k] == '') {
          this.$message.error('请输入所有完整信息');
          return false;
        }
      }

      this.$api.getwlhuajieadd({
        objectName: this.form.name,
        phone: this.form.number,
        handleTime: this.form.time,
        consultingTypeOption: this.form.leibie,
        content: this.form.textarea
      }).then(function (res) {
        if (res.code === 0) {
          _this.$message.success('提交成功');

          _this.$router.push({
            name: 'ajdjb'
          });
        } else {
          _this.$message.error('提交失败');
        }
      });
    },
    goback: function goback() {
      this.$router.go(-1);
    }
  }
};
